const INITIAL_STATE = {
  data:[]
}

export default function AssetDevicesReducer(state = INITIAL_STATE, action) {
    switch (action.type) {
      case "FETCH_ASSET_DEVICES":
        const toos = action.payload
        return {
          data: [...state.data, {asset:action.payload}]
        };
      default:
        return state;
    }
  }
